import { Media, NavLink } from "reactstrap";
import { Link } from "react-router-dom";
import "./Symptoms.module.css";

//images
// import feverImg from "../../assets/images/fever.png";
// import sickImg from "../../assets/images/cough.png";
// import coughImg from "../../assets/images/sick.png";

import styles from "./Symptoms.module.css";

class Symptoms extends Component {
  render() {
    return (
      <>
        <div>
          <center>
            <h1>COVID-19 Coronavirus - Symptoms</h1>
            <p>
              Thereâ€™s currently no vaccine to prevent coronavirus disease
              (COVID-19).
            </p>
          </center>
          <div style={{ margin: "100px" }}>
            <p
              style={{
                color: "red",
                fontSize: "15px"
              }}
            >
              <strong>
                Note: In case of any of the symptoms mentioned below you should
                not leave your home. You should lockdown yourself in a room and
                should avoid contact with any family member.
              </strong>
            </p>
          </div>
          <div style={{ margin: "100px" }}>
            <h3>Symptoms of Coronavirus</h3>
            <p>
              The most common symptoms of COVID-19 are fever, tiredness, and dry
              cough. Some patients may have aches and pains, nasal congestion,
              runny nose, sore throat or diarrh
            </p>
          </div>



          <div style={{ margin: "100px" }}>
            <Link to="/prevention" className={styles.navLink}>
              Prevention
            </Link>

            <br />
            <Link to="/faq" className={styles.navLink}>
              FAQ
            </Link>
          </div>
        </div>
      </>
    );
  }
}

export default Symptoms;
